"use strict";
var helpers = require('syracuse-core').helpers;
var CvgObservable = require('syracuse-x3/lib/convergence/model/CvgObservable').CvgObservable;

var CvgReboot = helpers.defineClass(function(client, str1, str2, str3, str4, str5, str6, str7, str8, str9, str10, str11, str12, str13, str14, str15, str16, str17) {
	CvgObservable.call(this, client);
	this.cnxStrg = [str1, str2, str3, str4, str5, str6, str7, str8, str9, str10, str11, str12, str13, str14, str15, str16, str17];
	// En dernier
	this.setJsonType('SESSION');
}, CvgObservable, {
	toJSON: function() {
		var reboot = {
			cnxStrg: this.cnxStrg
		};
		return {
			reboot: reboot
		};
	}
});

// Factory pattern avoids jslint/jshint complaining about using "new" for side effects
exports.create = function(client, str1, str2, str3, str4, str5, str6, str7, str8, str9, str10, str11, str12, str13, str14, str15, str16, str17) {
	return new CvgReboot(client, str1, str2, str3, str4, str5, str6, str7, str8, str9, str10, str11, str12, str13, str14, str15, str16, str17);
};